import React, { Component, Fragment } from 'react';
import NavBar from '../nav-bar/component';
import SideBarNavigation from '../side-bar-navigation/component';

export default class App extends Component {
  render() {
    return (
      <Fragment>
        <NavBar />
        <SideBarNavigation />
      </Fragment>
    );
  }
}
